import React from 'react';
import { useParams } from 'react-router-dom';
import StaffData from '../data/StaffData';
const StaffDetail = () => {
  const { staffId } = useParams();
  const staff = StaffData.find((staff) => staff.STAFFS.id === staffId);
  return (
    <div>
      <img src={staff.STAFFS.images} alt="staff image" />
      <h1>Ho va ten : {staff.STAFFS.name}</h1>
      <p>Ngay sinh : {staff.STAFFS.doB} </p>
      <p>Ngay vao cong ty : {staff.STAFFS.startDate}</p>
      <p>Phong ban :{staff.STAFFS.departments.name} </p>
      <p>So ngay nghi :{staff.STAFFS.annualLeave}</p>
      <p>So ngay da lam them :{staff.STAFFS.overTime}</p>
    </div>
  );
};
export default StaffDetail;
